css:
.github-Accordion {
  cursor: default;
  user-select: none;
}
.github-Accordion-header {
  font-weight: 600;
  color: #7278af;
  padding: 7.5px;
  border-bottom: 1px solid #313557;
  display: flex;
  align-items: center;
}
.github-Accordion-header::-webkit-details-marker {
  color: #7278af;
}
.github-Accordion--rightTitle,
.github-Accordion--leftTitle {
  flex: 1;
}
.github-Accordion-content {
  border-bottom: 1px solid #313557;
  background-color: #22253d;
}
.github-Accordion-content:empty::before {
  content: "Empty";
  display: block;
  font-style: italic;
  text-align: center;
  color: #7278af;
}
.github-Accordion-list {
  margin: 0;
  padding: 0;
  list-style: none;
}
.github-Accordion[open] .github-Accordion-header {
  color: #bea8ce;
}
.github-Accordion-listItem {
  display: flex;
  align-items: center;
  padding: 3.75px;
  border-bottom: 1px solid #313557;
}
.github-Accordion-listItem:last-child {
  border: none;
}
.github-Accordion-listItem:active {
  background-color: #2b2f4d;
}
